import React from 'react'

export default class Contact extends React.Component{

    render() {
        return (
            <div id="contact">
                <h1>Let's Keep In Touch!</h1>
                <ul>
                <a href="mailto:minheekangg@gmail.com">Email: minheekangg@gmail.com</a>
                </ul>
                <ul>
                <a href="https://www.linkedin.com/in/min-hee-park-kang-1233ba69/">LinkedIn</a>
                </ul>
                <ul>
                <p>Github: </p><a href="_blank">minheekangg@gmail.com</a>
                </ul>

            </div>
        )
    }
}
